The way Burn handles gradients is different from PyTorch. First, when calling backward, each parameter doesn't have its grad field updated. Instead, the backward pass returns all the calculated gradients in a container. This approach offers numerous benefits, such as the ability to easily send gradients to other threads. You can also retrieve the gradient for a specific parameter using the grad method on a tensor. Since this method takes the gradients as input, it's hard to forget to call backward beforehand. Note that sometimes, using grad_remove can improve performance by allowing inplace operations. In PyTorch, when you don't need gradients for inference or validation, you typically need to scope your code using a block. # Inference mode
torch.inference(): # your code ... # Or no grad
torch.no_grad(): # your code ... With Burn, you don't need to wrap the backend with the Autodiff for inference, and you can call inner() to obtain the inner tensor, which is useful for validation. /// Use `B: AutodiffBackend`
fn example_validation<B: AutodiffBackend>(tensor: Tensor<B, 2>) { let inner_tensor: Tensor<B::InnerBackend, 2> = tensor.inner(); let _ = inner_tensor + 5;
} /// Use `B: Backend`
fn example_inference<B: Backend>(tensor: Tensor<B, 2>) { let _ = tensor + 5; ...
} Gradients with Optimizers We've seen how gradients can be used with tensors, but the process is a bit different when working with optimizers from burn-core. To work with the Module trait, a translation step is required to link tensor parameters with their gradients. This step is necessary to easily support gradient accumulation and training on multiple devices, where each module can be forked and run on different devices in parallel. We'll explore deeper into this topic in the Module section.

