As mentioned earlier, modules primarily function as parameter containers. Therefore, we naturally offer several ways to perform functions on each parameter. This is distinct from PyTorch, where extending module functionalities is not as straightforward. The map and visitor methods are quite similar but serve different purposes. Mapping is used for potentially mutable operations where each parameter of a module can be updated to a new value. In Burn, optimizers are essentially just sophisticated module mappers. Visitors, on the other hand, are used when you don't intend to modify the module but need to retrieve specific information from it, such as the number of parameters or a list of devices in use. You can implement your own mapper or visitor by implementing these simple traits: /// Module visitor trait.
pub trait ModuleVisitor<B: Backend> { /// Visit a tensor in the module. fn visit<const D: usize>(&mut self, id: &ParamId, tensor: &Tensor<B, D>);
} /// Module mapper trait.
pub trait ModuleMapper<B: Backend> { /// Map a tensor in the module. fn map<const D: usize>(&mut self, id: &ParamId, tensor: Tensor<B, D>) -> Tensor<B, D>;
}

