When working with the learner, you have the option to record metrics that will be monitored throughout the training process. We currently offer a restricted range of metrics. Metric Description Accuracy Calculate the accuracy in percentage Loss Output the loss used for the backward pass CPU Temperature Fetch the temperature of CPUs CPU Usage Fetch the CPU utilization CPU Memory Usage Fetch the CPU RAM usage GPU Temperature Fetch the GPU temperature Learning Rate Fetch the current learning rate for each optimizer step CUDA Fetch general CUDA metrics such as utilization In order to use a metric, the output of your training step has to implement the Adaptor trait from burn-train::metric. Here is an example for the classification output, already provided with the crate. /// Simple classification output adapted for multiple metrics.
#[derive(new)]
pub struct ClassificationOutput<B: Backend> { /// The loss. pub loss: Tensor<B, 1>, /// The output. pub output: Tensor<B, 2>, /// The targets. pub targets: Tensor<B, 1, Int>,
} impl<B: Backend> Adaptor<AccuracyInput<B>> for ClassificationOutput<B> { fn adapt(&self) -> AccuracyInput<B> { AccuracyInput::new(self.output.clone(), self.targets.clone()) }
} impl<B: Backend> Adaptor<LossInput<B>> for ClassificationOutput<B> { fn adapt(&self) -> LossInput<B> { LossInput::new(self.loss.clone()) }
}

