Generating your own custom metrics is done by implementing the Metric trait. /// Metric trait.
///
/// Implementations should define their own input type only used by the metric.
/// This is important since some conflict may happen when the model output is adapted for each
/// metric's input type.
///
/// The only exception is for metrics that don't need any input, setting the associated type
/// to the null type `()`.
pub trait Metric: Send + Sync { /// The input type of the metric. type Input; /// Updates the metric state and returns the current metric entry. fn update(&mut self, item: &Self::Input, metadata: &MetricMetadata) -> MetricEntry; /// Clear the metric state. fn clear(&mut self);
} As an example, let's see how the loss metric is implemented. /// The loss metric.
#[derive(Default)]
pub struct LossMetric<B: Backend> { state: NumericMetricState, _b: B,
} /// The loss metric input type.
#[derive(new)]
pub struct LossInput<B: Backend> { tensor: Tensor<B, 1>,
} impl<B: Backend> Metric for LossMetric<B> { type Input = LossInput<B>; fn update(&mut self, loss: &Self::Input, _metadata: &MetricMetadata) -> MetricEntry { let loss = f64::from_elem(loss.tensor.clone().mean().into_data().value[0]); self.state .update(loss, 1, FormatOptions::new("Loss").precision(2)) } fn clear(&mut self) { self.state.reset() }
} When the metric you are implementing is numeric in nature, you may want to also implement the Numeric trait. This will allow your metric to be plotted. impl<B: Backend> Numeric for LossMetric<B> { fn value(&self) -> f64 { self.state.value() }
}

