Transformations in Burn are all lazy and modify one or multiple input datasets. The goal of these transformations is to provide you with the necessary tools so that you can model complex data distributions. Transformation Description SamplerDataset Samples items from a dataset. This is a convenient way to model a dataset as a probability distribution of a fixed size. ShuffledDataset Maps each input index to a random index, similar to a dataset sampled without replacement. PartialDataset Returns a view of the input dataset with a specified range. MapperDataset Computes a transformation lazily on the input dataset. ComposedDataset Composes multiple datasets together to create a larger one without copying any data. Let us look at the basic usages of each dataset transform and how they can be composed together. These transforms are lazy by default except when specified, reducing the need for unnecessary intermediate allocations and improving performance. The full documentation of each transform can be found at the API reference . SamplerDataset : This transform can be used to sample items from a dataset with (default) or without replacement. Transform is initialized with a sampling size which can be bigger or smaller than the input dataset size. This is particularly useful in cases where we want to checkpoint larger datasets more often during training and smaller datasets less often as the size of an epoch is now controlled by the sampling size. Sample usage: type DbPedia = SqliteDataset<DbPediaItem>;
let dataset: DbPedia = HuggingfaceDatasetLoader::new("dbpedia_14") .dataset("train"). .unwrap(); let dataset = SamplerDataset<DbPedia, DbPediaItem>::new(dataset, 10000); ShuffledDataset : This transform can be used to shuffle the items of a dataset. Particularly useful before splitting the raw dataset into train/test splits. Can be initialized with a seed to ensure reproducibility. let dataset = ShuffledDataset<DbPedia, DbPediaItem>::with_seed(dataset, 42); PartialDataset : This transform is useful to return a view of the dataset with specified start and end indices. Used to create train/val/test splits. In the example below, we show how to chain ShuffledDataset and PartialDataset to create splits. // define chained dataset type here for brevity
type PartialData = PartialDataset<ShuffledDataset<DbPedia, DbPediaItem>>;
let dataset_len = dataset.len();
let split == "train"; // or "val"/"test" let data_split = match split { "train" => PartialData::new(dataset, 0, len * 8 / 10), // Get first 80% dataset "test" => PartialData::new(dataset, len * 8 / 10, len), // Take remaining 20% _ => panic!("Invalid split type"), // Handle unexpected split types }; MapperDataset : This transform is useful to apply a transformation on each of the items of a dataset. Particularly useful for normalization of image data when channel means are known. ComposedDataset : This transform is useful to compose multiple datasets downloaded from multiple sources (say different HuggingfaceDatasetLoader sources) into a single bigger dataset which can be sampled from one source.

