Even though Burn comes with a project dedicated to simplifying training, it doesn't mean that you have to use it. Sometimes you may have special needs for your training, and it might be faster to just reimplement the training loop yourself. Also, you may just prefer implementing your own training loop instead of using a pre-built one in general. Burn's got you covered! We will start from the same example shown in the basic workflow section, but without using the Learner struct. #[derive(Config)]
pub struct MnistTrainingConfig { #[config(default = 10)] pub num_epochs: usize, #[config(default = 64)] pub batch_size: usize, #[config(default = 4)] pub num_workers: usize, #[config(default = 42)] pub seed: u64, #[config(default = 1e-4)] pub lr: f64, pub model: ModelConfig, pub optimizer: AdamConfig,
} pub fn run<B: AutodiffBackend>(device: &B::Device) { // Create the configuration. let config_model = ModelConfig::new(10, 1024); let config_optimizer = AdamConfig::new(); let config = MnistTrainingConfig::new(config_model, config_optimizer); B::seed(config.seed); // Create the model and optimizer. let mut model = config.model.init(device); let mut optim = config.optimizer.init(); // Create the batcher. let batcher_train = MNISTBatcher::<B>::new(device.clone()); let batcher_valid = MNISTBatcher::<B::InnerBackend>::new(device.clone()); // Create the dataloaders. let dataloader_train = DataLoaderBuilder::new(batcher_train) .batch_size(config.batch_size) .shuffle(config.seed) .num_workers(config.num_workers) .build(MNISTDataset::train()); let dataloader_test = DataLoaderBuilder::new(batcher_valid) .batch_size(config.batch_size) .shuffle(config.seed) .num_workers(config.num_workers) .build(MNISTDataset::test()); ...
} As seen with the previous example, setting up the configurations and the dataloader hasn't changed. Now, let's move forward and write our own training loop: pub fn run<B: AutodiffBackend>(device: B::Device) { ... // Iterate over our training and validation loop for X epochs. for epoch in 1..config.num_epochs + 1 { // Implement our training loop. for (iteration, batch) in dataloader_train.iter().enumerate() { let output = model.forward(batch.images); let loss = CrossEntropyLoss::new(None).forward(output.clone(), batch.targets.clone()); let accuracy = accuracy(output, batch.targets); println!( "[Train - Epoch {} - Iteration {}] Loss {:.3} | Accuracy {:.3} %", iteration, epoch, loss.clone().into_scalar(), accuracy, ); // Gradients for the current backward pass let grads = loss.backward(); // Gradients linked to each parameter of the model. let grads = GradientsParams::from_grads(grads, &model); // Update the model using the optimizer. model = optim.step(config.lr, model, grads); } // Get the model without autodiff. let model_valid = model.valid(); // Implement our validation loop. for (iteration, batch) in dataloader_test.iter().enumerate() { let output = model_valid.forward(batch.images); let loss = CrossEntropyLoss::new(None).forward(output.clone(), batch.targets.clone()); let accuracy = accuracy(output, batch.targets); println!( "[Valid - Epoch {} - Iteration {}] Loss {} | Accuracy {}", iteration, epoch, loss.clone().into_scalar(), accuracy, ); } }
} In the previous code snippet, we can observe that the loop starts from epoch 1 and goes up to num_epochs. Within each epoch, we iterate over the training dataloader. During this process, we execute the forward pass, which is necessary for computing both the loss and accuracy. To maintain simplicity, we print the results to stdout. Upon obtaining the loss, we can invoke the backward() function, which returns the gradients specific to each variable. It's important to note that we need to map these gradients to their corresponding parameters using the GradientsParams type. This step is essential because you might run multiple different autodiff graphs and accumulate gradients for each parameter id. Finally, we can perform the optimization step using the learning rate, the model, and the computed gradients. It's worth mentioning that, unlike PyTorch, there's no need to register the gradients with the optimizer, nor do you have to call zero_grad. The gradients are automatically consumed during the optimization step. If you're interested in gradient accumulation, you can easily achieve this by using the GradientsAccumulator. let mut accumulator = GradientsAccumulator::new();
let grads = model.backward();
let grads = GradientsParams::from_grads(grads, &model);
accumulator.accumulate(&model, grads); ...
let grads = accumulator.grads(); // Pop the accumulated gradients. Note that after each epoch, we include a validation loop to assess our model's performance on previously unseen data. To disable gradient tracking during this validation step, we can invoke model.valid(), which provides a model on the inner backend without autodiff capabilities. It's important to emphasize that we've declared our validation batcher to be on the inner backend, specifically MNISTBatcher<B::InnerBackend>; not using model.valid() will result in a compilation error. You can find the code above available as an example for you to test.

