The explanations above demonstrate how to create a basic training loop. However, you may find it beneficial to organize your program using intermediary types. There are various ways to do this, but it requires getting comfortable with generics. If you wish to group the optimizer and the model into the same structure, you have several options. It's important to note that the optimizer trait depends on both the AutodiffModule trait and the AutodiffBackend trait, while the module only depends on the AutodiffBackend trait. Here's a closer look at how you can create your types: Create a struct that is generic over the backend and the optimizer, with a predefined model. struct Learner<B, O>
where B: AutodiffBackend,
{ model: Model<B>, optim: O,
} This is quite straightforward. You can be generic over the backend since it's used with the concrete type Model in this case. Create a struct that is generic over the model and the optimizer. struct Learner<M, O> { model: M, optim: O,
} This option is a quite intuitive way to declare the struct. You don't need to write type constraints with a where statement when defining a struct; you can wait until you implement the actual function. However, with this struct, you may encounter some issues when trying to implement code blocks to your struct. impl<B, M, O> Learner<M, O>
where B: AutodiffBackend, M: AutodiffModule<B>, O: Optimizer<M, B>,
{ pub fn step(&mut self, _batch: MNISTBatch<B>) { // }
} This will result in the following compilation error: 1. the type parameter `B` is not constrained by the impl trait, self type, or predicates unconstrained type parameter [E0207] To resolve this issue, you have two options. The first one is to make your function generic over the backend and add your trait constraint within its definition: #[allow(dead_code)]
impl<M, O> Learner2<M, O> { pub fn step<B: AutodiffBackend>(&mut self, _batch: MNISTBatch<B>) where B: AutodiffBackend, M: AutodiffModule<B>, O: Optimizer<M, B>, { // }
} However, some people may prefer to have the constraints on the implementation block itself. In that case, you can make your struct generic over the backend using PhantomData<B>. Create a struct that is generic over the backend, the model, and the optimizer. struct Learner3<B, M, O> { model: M, optim: O, _b: PhantomData<B>,
} You might wonder why PhantomData is required. Each generic argument must be used as a field when declaring a struct. When you don't need the generic argument, you can use PhantomData to mark it as a zero sized type. These are just some suggestions on how to define your own types, but you are free to use any pattern that you prefer.

