First, we need to determine the type signature of our newly created operation by defining our custom backend traits. As we will use the associated type TensorPrimitive of the Backend trait, which encapsulates the underlying tensor implementation of the backend, we will use a type alias to avoid the ugly disambiguation with associated types. /// We use a type alias for better readability.
pub type FloatTensor<B, const D: usize> = <B as burn::tensor::backend::Backend>::TensorPrimitive<D>; /// We create our own Backend trait that extends the Burn backend trait.
pub trait Backend: burn::tensor::backend::Backend { fn fused_matmul_add_relu<const D: usize>( lhs: FloatTensor<Self, D>, rhs: FloatTensor<Self, D>, bias: FloatTensor<Self, D>, ) -> FloatTensor<Self, D>;
} /// We create our own AutodiffBackend trait that extends the Burn autodiff backend trait.
pub trait AutodiffBackend: Backend + burn::tensor::backend::AutodiffBackend {} In our project, we can use these traits instead of the burn::tensor::backend::{Backend, AutodiffBackend} traits provided by Burn. Burn's user APIs typically make use of the Tensor struct rather than dealing directly with primitive tensor types. Therefore, we can encapsulate our newly defined backend traits with functions that expose new operations while maintaining a consistent API. /// We define our custom implementation using the added function on our custom backend.
pub fn matmul_add_relu_custom<B: Backend>( lhs: Tensor<B, 3>, rhs: Tensor<B, 3>, bias: Tensor<B, 3>,
) -> Tensor<B, 3> { let output = B::fused_matmul_add_relu( lhs.into_primitive(), rhs.into_primitive(), bias.into_primitive(), ); Tensor::from_primitive(output)
} /// We define a reference implementation using basic tensor operations.
pub fn matmul_add_relu_reference<B: Backend>( lhs: Tensor<B, 3>, rhs: Tensor<B, 3>, bias: Tensor<B, 3>,
) -> Tensor<B, 3> { let x = lhs.matmul(rhs) + bias; activation::relu(x)
} Note that we also provide a reference implementation for testing purposes, which allows us to easily validate our new implementation. While not mandatory, having a reference implementation can be valuable, especially in projects where creating a reference implementation solely using basic tensor operations is feasible.

