@workgroup_size({{ workgroup_size_x }}, {{ workgroup_size_y }}, 1)
fn main( @builtin(global_invocation_id) global_id: vec3<u32>, @builtin(local_invocation_index) local_idx: u32, @builtin(workgroup_id) workgroup_id: vec3<u32>,
) { // Indices let row = workgroup_id.x * BLOCK_SIZE + (local_idx / BLOCK_SIZE); let col = workgroup_id.y * BLOCK_SIZE + (local_idx % BLOCK_SIZE); let batch = global_id.z; // Basic information let dim = info[0]; let n_rows = info[6u * dim - 1u]; let n_cols = info[6u * dim]; let K = info[5u * dim - 1u]; // Returns if outside the output dimension if row >= n_rows || col >= n_cols { return; } // Calculate the corresponding offsets with support for broadcasting. let offset_output = batch * n_rows * n_cols; var offset_lhs: u32 = 0u; var offset_rhs: u32 = 0u; let batch_dims = dim - 2u; for (var b: u32 = 1u; b <= batch_dims; b++) { let stride_lhs = info[b]; let stride_rhs = info[b + dim]; let stride_output = info[b + 2u * dim]; let shape_lhs = info[b + 3u * dim]; let shape_rhs = info[b + 4u * dim]; offset_lhs += offset_output / stride_output % shape_lhs * stride_lhs; offset_rhs += offset_output / stride_output % shape_rhs * stride_rhs; } // Basic matmul implementation var sum = 0.0; for (var k: u32 = 0u; k < K; k++) { let lhs_index = row * K + k; let rhs_index = k * n_cols + col; sum += lhs[offset_lhs + lhs_index] * rhs[offset_rhs + rhs_index]; } let output_index = row * n_cols + col; let index = offset_output + output_index; // Add and ReLU output[index] = max(sum + bias[index], 0.0);
} Now, let's move on to the next step, which involves implementing the remaining code to launch the kernel. The initial part entails loading the template and populating it with the appropriate variables. The register(name, value) method simply replaces occurrences of {{ name }} in the above WGSL code with some other string before it is compilated. // Source the kernel written in WGSL.
kernel_wgsl!(FusedMatmulAddReluRaw, "./kernel.wgsl"); // Define our kernel type with workgroup information.
#[derive(new, Debug)]
struct FusedMatmulAddRelu<E: FloatElement> { workgroup_size_x: usize, workgroup_size_y: usize, _elem: PhantomData<E>,
} // Implement the dynamic kernel trait for our kernel type.
impl<E: FloatElement> DynamicKernel for FusedMatmulAddRelu<E> { fn source_template(self) -> SourceTemplate { // Extend our raw kernel with workgroup size information using the // `SourceTemplate` trait. FusedMatmulAddReluRaw::source_template() .register("workgroup_size_x", self.workgroup_size_x.to_string()) .register("workgroup_size_y", self.workgroup_size_y.to_string()) .register("elem", E::type_name()) } fn id(&self) -> String { format!("{:?}", self) }
} Subsequently, we'll go into implementing our custom backend trait for the WGPU backend. /// Implement our custom backend trait for the existing backend `Wgpu`.
impl<G: GraphicsApi, F: FloatElement, I: IntElement> Backend for Wgpu<G, F, I> { fn fused_matmul_add_relu<const D: usize>( lhs: FloatTensor<Self, D>, rhs: FloatTensor<Self, D>, bias: FloatTensor<Self, D>, ) -> WgpuTensor<F, D> { // Define workgroup size, hardcoded for simplicity. let workgroup_size_x = 16; let workgroup_size_y = 16; lhs.assert_is_on_same_device(&rhs); lhs.assert_is_on_same_device(&bias); // For simplicity, make sure each tensor is continuous. let lhs = into_contiguous(lhs); let rhs = into_contiguous(rhs); let bias = into_contiguous(bias); // Get the matmul relevant shapes. let num_rows = lhs.shape.dims[D - 2]; let num_cols = rhs.shape.dims[D - 1]; // Compute shape of output, while tracking number of batches. let mut num_batches = 1; let mut shape_out = [0; D]; for i in 0..D - 2 { shape_out[i] = usize::max(lhs.shape.dims[i], rhs.shape.dims[i]); num_batches *= shape_out[i]; } shape_out[D - 2] = num_rows; shape_out[D - 1] = num_cols; let shape_out = Shape::new(shape_out); // Create a buffer for the output tensor. let buffer = lhs .context .create_buffer(shape_out.num_elements() * core::mem::size_of::<F>()); // Create the output tensor primitive. let output = WgpuTensor::new(lhs.context.clone(), shape_out, buffer); // Create the kernel. let kernel = FusedMatmulAddRelu::<F>::new(workgroup_size_x, workgroup_size_y); // Build info buffer with tensor information needed by the kernel, such as shapes and strides. let info = build_info(&[&lhs, &rhs, &output]); let info_buffer = lhs .context .create_buffer_with_data(bytemuck::cast_slice(&info)); // Declare the wgsl workgroup with the number of blocks in x, y and z. let blocks_needed_in_x = f32::ceil(num_rows as f32 / workgroup_size_x as f32) as u32; let blocks_needed_in_y = f32::ceil(num_cols as f32 / workgroup_size_y as f32) as u32; let workgroup = WorkGroup::new(blocks_needed_in_x, blocks_needed_in_y, num_batches as u32); // Execute lazily the kernel with the launch information and the given buffers. lhs.client.execute( Box::new(DynamicKernel::new(kernel, workgroup)), &[ &lhs.handle, &rhs.handle, &bias.handle, &output.handle, &info_handle, ], ); // Return the output tensor. output }
} In the preceding code block, we demonstrated how to launch the kernel that modifies the correct buffer. It's important to note that Rust's mutability safety doesn't apply here; the context has the capability to execute any mutable operation on any buffer. While this isn't a problem in the previous scenario where we only modify the newly created output buffer, it is wise to keep this in mind.

